import React from 'react';
import logo from './logo.svg';
import './App.css';
import Layout from './Compnonents/layout/Layout';
import {BrowserRouter} from 'react-router-dom';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Layout/>
      </BrowserRouter>
    </div>
  );
}

export default App;
